  const [results, setResults] = useState([])
  useEffect(() => {
    axios
      .get('./Foodsource.json')
      .then(res => { 
        setResults(res.data)
        setHasNextPage(Boolean(res.length))
        setIsLoading(false)
      })
      .catch(e => {
        setIsLoading(false)
        if (signal.aborted) return
        setIsError(true)
        setError({ message: e.message })
    })
    return () => controller.abort()
  },[]);
  const displayData = results.map(
    (info)=> {
      return(
        <tr>
          <td>{info.resteraunt}</td>
          <td>{info.name}</td>
          <td>{info.people}</td>
          <td>{info.timetag}</td>
        </tr>
      )
    }
  )

  return (
    <div className="App">
      <div>
      <table class="table table-striped">
        <thead>
          <tr align="left">
            <th>Food Item</th>
            <th>Resteraunt</th>
            <th>Number of times bought</th>
            <th>How recently bought</th>
          </tr>
        </thead>
        <tbody>
          {displayData}
        </tbody>
      </table>
    </div>
    </div>


  );
}
